  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objectives of the Chautauqua
  National Wildlife Refuge complex are to provide optimum conditions for resting,
  migrating waterfowl and to perpetuate optimum production of wood ducks. To meet
  these objectives, it may become necessary to control predators and wildlife, such
  as beaver, which may damage the habitat or control structures necessary to maintain
  optimum waterfowl habitat. This must be balaned by the secondary objectives of maintaining
  balanced populations of all resident wildlife species and providing the public with
  adequate opportunity to view wildlife species.\",\n\t\"license_title\": \"License
